import React from 'react';
import classes from './Blog.module.css';
import NavList from '../../components/NavList/NavList';

const blog = (props) => (
  <>
    <header className={classes.Header}>
      <h1 className={classes.Title}>{props.appName} page</h1>
      <nav>
        <ul className={classes.Ul}>
          <NavList navContent='About Lu' href='' link='/' />
          <NavList navContent='Contact' href='#contact' link='/../#contact' />
          <NavList navContent='Blog' href='' link='/blog' />
        </ul>
      </nav>
    </header>
    <h2>Blog</h2>
    <p>
      Lorem ipsum dolor sit amet consectetur adipisicing elit. Amet deserunt
      delectus porro aliquid, doloribus quo et! Autem, magni, dicta ab beatae
      sint suscipit facilis eveniet consectetur assumenda provident incidunt
      quo.
    </p>
  </>
);

blog.getInitialProps = (context) => {
  const promise = new Promise((resolve, reject) => {
    setTimeout(() => {
      resolve({ appName: 'Blog' });
    }, 1000);
  });
  return promise;
};

export default blog;
